import React from 'react'
import './Banner.css';
import logo from '../images/profile.png'



class Banner extends React.Component {
    render(){
        return (
        <>
            <img className="feature" src={logo} />
            <p class="playlist">PLAYLIST</p>
			<h2 class="thisis">This Is Chalida Pisuraj</h2>
			<p class="description">Currently seeking full-time positions as a Software Engineer and UI/UX Designer/Engineer.
					<br>Recent UC Irvine Computer Science and Engineering grad.</br>
			</p>
			
        </>
        )
    }
}

export default Banner;
